$().ready(function(){const a=function(b,d,c,f,e){let bill=e!==undefined;let billClass=bill&&e>0?"text-danger":"text-success";e=e>0?("+"+e):(e+"");return'<li class="list-group-item d-flex align-items-center">\n    <div class="img-profile mr-3">\n        <img class="w-100 rounded-circle"\n             src="'+b+'"\n             alt="头像而已">\n        <div class="status-indicator"></div>\n    </div>\n    <div class="w-100'+(bill?"pr-rem-5":"")+'">\n        <div class="text-truncate">'+d+'</div>\n        <div class="small text-gray-500">'+c+" · "+utils.whenIs(f)+"</div>\n    </div>\n"+(bill?('<p class="bill font-weight-bold '+billClass+'">'+e+"</p>\n"):"")+"</li>"};utils.subscribeEvent(CONST_VAL.clubChangedEventKey,function(b){utils.showLoading();utils.ajax("/admin/api/dashboard/"+b.id,{},"GET",function(c){let resData=c.data;$("#pageTitle").text(b.name);$("#enrollNumber").text(resData.enrollMembers);$("#activeMembers").text(resData.activeMembers);$("#activeBar").attr("style","width: "+(resData.activeMembers/resData.enrollMembers*100)+"%");$("#enableAssets").text(resData.assets);$("#roomUsage").text(resData.usage+"%");$("#usageBar").attr("style","width: "+resData.usage+"%");let logUlContainer=$("#logArea");logUlContainer.html("");let logATag=$("#allLogATag");if(resData.logs.content.length!==0){resData.logs.content.forEach(function(d){logUlContainer.append($(a(d.showHead,d.content,d.who,d.createTime)))});logATag.text("全部日志");logATag.attr("href","")}else{logATag.text("什么都没有...");logATag.attr("href","#")}let billUlContainer=$("#billArea");billUlContainer.html("");let billATag=$("#allBillATag");if(resData.bills.content.length!==0){resData.bills.content.forEach(function(d){billUlContainer.append($(a(d.showHead,d.info,d.who,d.createTime,d.cost)))});billATag.text("全部收支");billATag.attr("href","")}else{billATag.text("什么都没有...");billATag.attr("href","#")}},function(c){alert("数据加载失败，请尝试刷新页面或重新登录");console.error(c)},function(){utils.hideLoading()})})});